import React, { useEffect, useState } from 'react';

const CryptoCard = ({ crypto, previousPrice, onPriceUpdate, getCryptoFullName }) => {
  const [priceChange, setPriceChange] = useState(null);

  const symbol = crypto.instrument?.base || 'UNKNOWN';
  const fullName = getCryptoFullName(symbol);
  const currentPrice = parseFloat(crypto.prices?.last || 0);

  useEffect(() => {
    if (previousPrice && previousPrice !== currentPrice) {
      const change = ((currentPrice - previousPrice) / previousPrice) * 100;
      const isPositive = change >= 0;

      setPriceChange({
        class: isPositive ? 'positive' : 'negative',
        icon: isPositive ? '↑' : '↓',
        text: `${isPositive ? '+' : ''}${change.toFixed(2)}%`,
        value: change
      });
    } else if (!priceChange) {
      setPriceChange({
        class: 'neutral',
        icon: '→',
        text: '0.00%',
        value: 0
      });
    }

    onPriceUpdate(symbol, currentPrice);
  }, [currentPrice, previousPrice, symbol, onPriceUpdate, priceChange]);

  const formatPrice = (price) => {
    if (price >= 1000) {
      return `$${price.toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 })}`;
    } else if (price >= 1) {
      return `$${price.toFixed(2)}`;
    } else {
      return `$${price.toFixed(4)}`;
    }
  };

  const formatVolume = (volume) => {
    if (volume >= 1000000000) {
      return `$${(volume / 1000000000).toFixed(2)}B`;
    } else if (volume >= 1000000) {
      return `$${(volume / 1000000).toFixed(2)}M`;
    } else if (volume >= 1000) {
      return `$${(volume / 1000).toFixed(2)}K`;
    } else {
      return `$${volume.toFixed(2)}`;
    }
  };

  return (
    <div className="crypto-card">
      <div className="crypto-header">
        <div className="crypto-name">
          <div className="crypto-icon">{symbol.substring(0, 2)}</div>
          <div>
            <div className="crypto-symbol">{symbol}</div>
            <div className="crypto-fullname">{fullName}</div>
          </div>
        </div>
      </div>

      <div className="crypto-price">
        {formatPrice(currentPrice)}
      </div>

      <div className={`price-change ${priceChange?.class || 'neutral'}`}>
        {priceChange?.icon} {priceChange?.text}
      </div>

      <div className="crypto-details">
        <div className="detail-item">
          <span className="detail-label">24h Volume</span>
          <span className="detail-value">{formatVolume(crypto.prices?.volume_24h || 0)}</span>
        </div>
        <div className="detail-item">
          <span className="detail-label">Market Cap</span>
          <span className="detail-value">{formatVolume(crypto.prices?.market_cap || 0)}</span>
        </div>
        <div className="detail-item">
          <span className="detail-label">24h High</span>
          <span className="detail-value">{formatPrice(crypto.prices?.high_24h || 0)}</span>
        </div>
        <div className="detail-item">
          <span className="detail-label">24h Low</span>
          <span className="detail-value">{formatPrice(crypto.prices?.low_24h || 0)}</span>
        </div>
      </div>
    </div>
  );
};

export default CryptoCard;
